CREATE DEFINER=`admin`@`%` PROCEDURE `calculate_physician_salary`(in physicianId int)
BEGIN
	declare base float default 0.5;
	SELECT 
    p.physician_id,
    CONCAT(physician_fname, ' ', physician_lname) AS Name,
    SUM(procedure_cost) AS "total_revenue_made_for_clinic",
    (SUM(procedure_cost) * base) AS salary
FROM
    physician p
        JOIN
    appointment a ON p.physician_id = a.physician_id
        JOIN
    patient_notes pn ON a.appointment_id = pn.appointment_id
        JOIN
    Group9Database.procedure proc ON pn.procedure_id = proc.procedure_id
GROUP BY p.physician_id
